import React, { useEffect, useState } from 'react';

interface Props {
    products: string[];
    onSelectItem: (item)
}

const ListGroupItem = (props: Props) => {
    const [selectItem, setSelectItem] = useState(-1)


    return (
        <div>
            <nav className="mt-10 max-h-100 overflow-y-auto">
                <ul>
                    {props.products && props.products.map((record, index) => (
                        // <a
                        //   href="#"
                        //   className="block py-2.5 px-4 text-gray-100 hover:bg-gray-100 hover:text-gray-800"
                        // >
                        //   {record.fields.title}
                        // </a>
                        <li key={record.pk}
                            className={selectItem === index ? "block py-2.5 px-4 text-gray-100" : "block py-2.5 px-4 text-gray-800"}
                            onClick={() => { setSelectItem(index) }}
                        // onClick={() => console.log(`${record.fields.title}`)}
                        >{record.fields.title}- {record.pk}</li>
                    ))
                    }
                </ul>
            </nav>
        </div>
    )
}

export default ListGroupItem
